import React from "react";
import Home from "./Components/pages/Home";
import Navbar from "./Components/Navbar/Navbar";

import { Route, Switch } from "react-router-dom";

const App = () => {
  return (
    <Route>
      <Navbar />
      <Home />
    </Route>
  );
};

export default App;
